import React from "react";
import ReactDOM from "react-dom";


const Card = () =>{
    return(
        <>
        <div className="cards">
            <div className="card">
                <img src="https://wallpapercave.com/wp/wp4056410.jp" alt="myPic" className="card_img" />
                <div className="card_info"> 
                 <span className="card_category"> A Netflix Original Series </span>
                 <h3 className="card_title"> Dark </h3>
                 <a href="" target="blank">
                    <button> Watch Now </button>
                    </a>
                </div>
            </div>
        </div>
        </>

    )

}




ReactDOM.render(
    <>
    <Card imgsrc="https://wallpapercave.com/wp/wp4056410.jpg"
    title="A netflix Orginal Series"
    sname = 'Dark'
    link="https://www.netflix.com/in/title/80990668?source=35"
    />
    <Card/>
    </>,
    document.getElementById("root")
);


